import * as React from 'react';
import Box from '@mui/material/Box';
import {  Button, Chip, Typography } from '@mui/material';
import Jobtitle from './Jobtitle'

export default function BoxSystemProps({ job }) {
  return (
    <Box
      bgcolor="#424242"
      height={250}
      width={300}
      my={5}
      display="flex"
      flexDirection="column"
      justifyContent="space-between"
      gap={2}
      p={2}
      marginLeft={5}
      borderRadius={3}
    >
    <Box>
      <Typography
        textAlign="center"
        color="#fff"
      >
        {job.title}
      </Typography>
      <Box
      marginT
      >
        <Chip label="Chip Filled" />
      </Box>
      <Typography
        color="#fff"
      >
        {job.description}
      </Typography>
    </Box>
    <Button
      variant="contained"
      sx={{
          backgroundColor: '#ff8f00',
          '&:hover': {
            backgroundColor: '#ff8f00', // Màu nền khi hover
          },
          alignSelf: 'center',
          
        }}
    >
      <Typography
      style={{
        color: '#000',
        fontSize: '0.8rem',
        fontWeight: '550'
      }}
      >
        learn More
      </Typography>
    </Button>
  </Box>
  );
}
